INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 91002, 100, 8, 0, 1, "", 40000, 0, "", 36);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (1, 91002, 150, 8, 107501, 1, "ぺコリーヌ", 40001, 0, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 37);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (1, 91002, 150, 8, 107601, 2, "コッコロ", 40001, 0, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 38);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (1, 91002, 150, 8, 107801, 3, "キャル", 40001, 0, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 39);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (1, 91002, 150, 8, 107701, 4, "スズメ", 40001, 0, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (1, 91002, 150, 8, 107901, 5, "タマキ", 40001, 0, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 41);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (2, 91002, 150, 8, 107501, 6, "ぺコリーヌ", 40001, 0, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 42);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (2, 91002, 150, 8, 107601, 7, "コッコロ", 40001, 0, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 43);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (2, 91002, 150, 8, 107801, 8, "キャル", 40001, 0, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 44);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (2, 91002, 150, 8, 107701, 9, "スズメ", 40001, 0, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 45);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (2, 91002, 150, 8, 107901, 10, "タマキ", 40001, 0, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 46);
